import React from 'react';
import ReactDOM from 'react-dom';
import axios from 'axios';
import Modal from 'react-modal';
import CustomerModal from 'components/Modal.js';

import {
    Button,
    FormGroup,
    Input,
    Container,
    Row,
    Col
} from "reactstrap";

class Cars extends React.Component {
    constructor(props) {
        super(props);

        this.state = {
            posts: [],
            loading: true,
            error: null
        };
    }


    componentDidMount() {
        // Remove the 'www.' to cause a CORS error (and see the error state)
        axios.get("http://desmond.business:8080/fyp/getBiddings")
            .then(res => {
                // Transform the raw data by extracting the nested posts

                const posts = res.data.results;
                //console.log(posts);
                // Update state to trigger a re-render.
                // Clear any errors, and turn off the loading indiciator.
                this.setState({
                    posts,
                    lastID: posts[0].id + 1,
                    title: posts[0].title,
                    sellingPrice: posts[0].selling_price,
                    sellerID: posts[0].seller_customer_id,
                    loading: false,
                    error: null
                });
            })
            .catch(err => {
                // Something went wrong. Save the error in state and re-render.
                this.setState({
                    loading: false,
                    error: err
                });
            });
    }

    renderLoading() {
        return <div>Loading...</div>;
    }

    renderError() {
        return (
            <div>
                Uh oh: {this.state.error.message}
            </div>
        );
    }

    renderPosts() {
        if (this.state.error) {
            return this.renderError();
        }

        console.log(this.state.posts[0]);
        return (
            <h6>
                Success getting Bidding Records
            </h6>
        );
    }

    render() {
        const { posts } = this.state;

        return (

            <div className="section section-buttons">
                <Container>
                    {posts.forEach({

                    })}
                    <h3>{this.state.sellingPrice}</h3>
                    <div className="title">
                        <h3>Sell Information</h3>
                    </div>
                    <CustomerModal />
                    <form onSubmit={this.handleSubmit}>
                        <Row>
                            <Col sm="3">LastID</Col>
                            <Col sm="4">
                                <FormGroup>
                                    <Input
                                        id="lastID"
                                        name="lastID"
                                        placeholder={this.state.lastID}
                                        type="text"
                                        onChange={this.handleInputChange}
                                        ref={(input) => this.myinput = input} />
                                </FormGroup>
                            </Col>
                        </Row>
                        <Row>
                            <Col sm="3">Product Title</Col>
                            <Col sm="4">
                                <FormGroup>
                                    <Input
                                        id="title"
                                        name="title"
                                        placeholder={this.state.title}
                                        type="text"
                                        onChange={this.handleInputChange}
                                        ref={(input) => this.myinput = input} />
                                </FormGroup>
                            </Col>
                        </Row>
                        <Row>
                            <Col sm="3">Selling Price</Col>
                            <Col sm="4">
                                <FormGroup>
                                    <Input
                                        id="sellingPrice"
                                        name="sellingPrice"
                                        placeholder={this.state.sellingPrice}
                                        type="text"
                                        onChange={this.handleInputChange}
                                        ref={(input) => this.myinput = input} />
                                </FormGroup>
                            </Col>
                        </Row>
                        <Row>
                            <Col sm="3">seller_customer_id</Col>
                            <Col sm="4">
                                <FormGroup>
                                    <Input
                                        id="sellerID"
                                        placeholder={this.state.sellerID}
                                        type="text"
                                        onChange={this.handleInputChange}
                                        ref={(input) => this.myinput = input} />
                                </FormGroup>
                            </Col>
                            <Col>
                                <Button
                                    className="btn-round mr-1"
                                    color="primary"
                                    type="button"
                                    onClick={this.handleSubmit}
                                >
                                    Sell this out !!!
                </Button>
                            </Col>
                        </Row>
                        <br />
                    </form>
                </Container>
            </div>
        );
    }
}
